import { createId } from 'src/helpers/book_id';
import { actionTypes, bookFields, authorFields } from './constants';

const { title, authors, pages, publishingHouses, year, releaseDate, isbn, img } = bookFields;
const { name, lastname } = authorFields;

const defaultState = [
  {
    [title]: 'Совершенный код',
    [authors]: [
      {
        [name]: 'Стив',
        [lastname]: 'Макконнелл',
      },
    ],
    [pages]: 896,
    [publishingHouses]: 'Русская редакция',
    [year]: 2017,
    [releaseDate]: 1483218000000,
    [isbn]: '978-5-7502-0064-1',
    [img]:
      'data:image/jpeg;base64,',
  },
  {
    [title]: 'Алгоритмы. Построение и анализ',
    [authors]: [
      {
        [name]: 'Томас',
        [lastname]: 'Кормен',
      },
      {
        [name]: 'Чарльз',
        [lastname]: 'Лейзерсон',
      },
      {
        [name]: 'Рональд',
        [lastname]: 'Ривест',
      },
      {
        [name]: 'Клиффорд',
        [lastname]: 'Штайн ',
      },
    ],
    [pages]: 1328,
    [publishingHouses]: 'Диалектика',
    [year]: 2018,
    [releaseDate]: 1514754000000,
    [isbn]: '978-5-907114-11-2',
    [img]: '',
  },
];

export default (state = defaultState, action) => {
  switch (action.type) {
    case actionTypes.ADD:
      return [action.book, ...state];
    case actionTypes.EDIT:
      return state.map(book =>
        createId(book) === createId(action.book) ? { ...book, ...action.newData } : book
      );
    case actionTypes.DELETE:
      return state.filter(book => createId(book) !== createId(action.book));
    default:
      return state;
  }
};
